import { Routes, Route } from "react-router-dom";
import React from 'react';
import './App.css';
import Login from './page/Login.js';

function App() {
    return (
        <Router>
            <div>
            <Routes>
                <Route path="/" element={<Login />} />
                {/* Add more routes as needed */}
            </Routes>
            </div>
      </Router>
    );
}

export default App;
